INSERT INTO `informes` (`id`, `title`, `content`, `reporte_id`, `created_at`, `updated_at`) VALUES
(1, 'INFORME PRUEBA', '<p>FSDFSDFF</p>\r\n\r\n<p>SFSD</p>\r\n\r\n<p>SDFS</p>\r\n\r\n<p>DFSD</p>\r\n\r\n<p>FSD</p>\r\n\r\n<p>FSD</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>SDF</p>', '1', '2018-11-10 02:24:24', '2018-11-10 02:24:24'),
(2, 'ERIK VIERNES', '<h3><strong><em>EL ESTUDIO ULTRASONOGRAFICO REALIZADO CON ECOGRAFO MARCA ESAOTE MODELO </em>&laquo;ecografo&raquo; <em>METODO 2D BN EN TIEMPO REAL UTILIZANDO TRANSDUCTOR VOLUMETRICO MULTIFRECUENCIAL PARA LA EVALUACION DEL ABDOMEN SUPERIOR, MUESTRA:</em></strong></h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>H&iacute;gado:</h3>\r\n\r\n<h3>De forma, situaci&oacute;n y tama&ntilde;o conservado. Mide 150mm de longitud a nivel del LHD. Presenta incremento difuso de la ecogenicidad parenquimal sin presencia de im&aacute;genes compatibles con procesos invasivos y/o expansivos. Espacio de Morrison libre de colecciones. V&iacute;as biliares, venas y ramas portales intrahep&aacute;ticas de calibre normal.&nbsp; Porta principal mide&nbsp; 8mm.&nbsp;</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ves&iacute;cula biliar:</strong></p>\r\n\r\n<p>Piriforme y distendida, siendo sus medidas de 76 x 20mm., para sus di&aacute;metros longitudinal y AP. Sus paredes se muestran engrosadas, mide 4mm., de grosor no dolorosas en la maniobra de eco pulsi&oacute;n actualmente.</p>\r\n\r\n<p>Al interior se aprecian m&uacute;ltiples im&aacute;genes hiperecog&eacute;nicas con sombra sonica posterior menores de 10mm proyectadas en la regi&oacute;n fundica y corporal.</p>\r\n\r\n<p>Col&eacute;doco proximal libre de c&aacute;lculos, mide 2mm.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>P&aacute;ncreas: </strong></p>\r\n\r\n<p>De forma caracter&iacute;stica conservada y ecogenicidad parenquimal homog&eacute;nea. No presenta formaciones nodulares ni quistes.</p>\r\n\r\n<p>Mide 23mm de di&aacute;metro AP a nivel de la cabeza.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Bazo:</strong></p>\r\n\r\n<p>Estructura y par&eacute;nquima homog&eacute;neo, bordes regulares y lisos, no presenta procesos invasivos y/o expansivos ni calcificaciones. Mide 106mm de longitud.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Estomago:</strong></p>\r\n\r\n<p>Visible a nivel antral visualiz&aacute;ndose espesor conservado del plano muscular el cual alcanza 4.3mm., de espesor mayor (valor referencial: &lt;5mm), patr&oacute;n mucoso de ecogenicidad conservada. Dem&aacute;s compartimentos del estomago no valorables por esta modalidad diagnostica.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>A&oacute;rta y vena cava inferior</strong> de calibre y trayectoria conservada, sus paredes son regulares y lisas.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>IDx:</em></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><em>ESTEATOSIS HEPATICA DIFUSA LEVE (GRADO I).</em></li>\r\n	<li><em>COLECISTITIS CRONICA LITIASICA.</em></li>\r\n	<li><em>DEMAS &Oacute;RGANOS ABDOMINALES NOMBRADOS ECOGRAFICAMENTE CONSERVADOS POR ESTA MODALIDAD Y/O TENICA DIAGNOSTICA.</em></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>S/S CORRELACIONAR CON DATOS CLINICOS, EXAMENES DE LABORATORIO Y CONTROL POSTERIOR</em></p>', '1', '2018-11-10 03:58:38', '2018-11-10 03:58:38'),
(3, 'INFORME MIERCOLES', '<h3><strong><em>EL ESTUDIO ULTRASONOGRAFICO REALIZADO CON ECOGRAFO MARCA ESAOTE MODELO </em>&laquo;ecografo&raquo; <em>METODO 2D BN EN TIEMPO REAL UTILIZANDO TRANSDUCTOR VOLUMETRICO MULTIFRECUENCIAL PARA LA EVALUACION DEL ABDOMEN SUPERIOR, MUESTRA:</em></strong></h3>\r\n\r\n<h3>H&iacute;gado:</h3>\r\n\r\n<h3>De forma, situaci&oacute;n y tama&ntilde;o conservado. Mide 150mm de longitud a nivel del LHD. Presenta incremento difuso de la ecogenicidad parenquimal sin presencia de im&aacute;genes compatibles con procesos invasivos y/o expansivos. Espacio de Morrison libre de colecciones. V&iacute;as biliares, venas y ramas portales intrahep&aacute;ticas de calibre normal.&nbsp; Porta principal mide&nbsp; 8mm.&nbsp;</h3>\r\n\r\n<p><strong>Ves&iacute;cula biliar:</strong></p>\r\n\r\n<p>Piriforme y distendida, siendo sus medidas de 76 x 20mm., para sus di&aacute;metros longitudinal y AP. Sus paredes se muestran engrosadas, mide 4mm., de grosor no dolorosas en la maniobra de eco pulsi&oacute;n actualmente.</p>\r\n\r\n<p>Al interior se aprecian m&uacute;ltiples im&aacute;genes hiperecog&eacute;nicas con sombra sonica posterior menores de 10mm proyectadas en la regi&oacute;n fundica y corporal.</p>\r\n\r\n<p>Col&eacute;doco proximal libre de c&aacute;lculos, mide 2mm.</p>\r\n\r\n<p><strong>P&aacute;ncreas: </strong>De forma caracter&iacute;stica conservada y ecogenicidad parenquimal homog&eacute;nea. No presenta formaciones nodulares ni quistes. Mide 23mm de di&aacute;metro AP a nivel de la cabeza.</p>\r\n\r\n<p><strong>Bazo:</strong>Estructura y par&eacute;nquima homog&eacute;neo, bordes regulares y lisos, no presenta procesos invasivos y/o expansivos ni calcificaciones. Mide 106mm de longitud.</p>\r\n\r\n<p><strong>Estomago:</strong>Visible a nivel antral visualiz&aacute;ndose espesor conservado del plano muscular el cual alcanza 4.3mm., de espesor mayor (valor referencial: &lt;5mm), patr&oacute;n mucoso de ecogenicidad conservada. Dem&aacute;s compa